public class Solution {
    public String[] solution(String[] input) {
        int len = input.length;
        for (int i = 0; i < len / 2; i++) {
            if (input[i].equals(".") &&!input[len - i - 1].equals(".")) {
                char temp = input[len - i - 1].charAt(0);
                if (temp == 'b') {
                    input[len - i - 1] = "h";
                    input[i] = "a";
                } else {
                    input[len - i - 1] = "a";
                    input[i] = "h";
                }
            } else if (!input[i].equals(".") && input[len - i - 1].equals(".")) {
                char temp = input[i].charAt(0);
                if (temp == 'b') {
                    input[i] = "h";
                    input[len - i - 1] = "a";
                } else {
                    input[i] = "a";
                    input[len - i - 1] = "h";
                }
            } else if (input[i].equals(".") && input[len - i - 1].equals(".")) {
                continue;
            } else {
                if (input[i].charAt(0)!= input[len - i - 1].charAt(0)) {
                    char temp = input[i].charAt(0);
                    input[i] = input[len - i - 1];
                    input[len - i - 1] = Character.toString(temp);
                }
            }
        }
        return input;
    }
}
